import React from 'react'

const Home = ()=>{
    return(
        <>
       <section id="header">
         <div className="container nav_bg">
            <div className="row">
                <div className="col-10 mx-auto">
                    <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                    <h1>Grow your bussiness with <strong>Sahil Zore</strong> </h1>
                    <h2 className="my-2">we are the team of talented developers making website</h2>
                    </div>
                </div>
            </div>
         </div>
       </section>
        </>
    );
}

export default Home;
